import React from 'react';
import { Navbar, Nav, Container, Button, Card } from 'react-bootstrap';
import { FaHeartbeat, FaMobileAlt, FaMoneyBillWave, FaSyncAlt, FaBatteryFull } from 'react-icons/fa';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

// Features Data
const features = [
  { icon: FaHeartbeat, title: "Predictive Analytics", desc: "We predict COPD exacerbations by monitoring SpO2 levels, respiratory rate, and activity trends, while hypertension spikes are detected using HRV, heart rate patterns, and stress data. Models such as LSTM, Random Forest, etc., analyze these inputs to provide timely risk alerts and actionable insights." },
  { icon: FaMobileAlt, title: "Emergency Alerts", desc: "Our device continuously monitors your vital signs, such as heart rate, SpO2, and respiratory rate. In case of a serious health issue, it instantly sends an alert to your emergency contact and nearby hospitals, providing real-time health data to ensure timely assistance." },
  { icon: FaMoneyBillWave, title: "Personalized Care Plans", desc: "Our app generates real-time electronic health reports, tracking vital signs like heart rate and SpO2. This unique feature helps doctors in India make accurate diagnoses and provide personalized treatments, improving overall care and effectiveness." },
  { icon: FaSyncAlt, title: "Real-Time Monitoring", desc: "Tracks heart rate, SpO2 levels, and other vital signs in real-time to provide continuous health updates for proactive care." },
  { icon: FaBatteryFull, title: "Dual Battery System", desc: "Two batteries allow 24/7 monitoring, where one charges while the other powers the device, ensuring uninterrupted use." }
];

// Inline CSS for customization
const styles = {
  body: {
    fontFamily: "'Arial', sans-serif",
    lineHeight: 1.6,
    backgroundColor: '#f4f4f9',
    color: '#333',
    padding: '0 1rem',
  },
  nav: {
    backgroundColor: '#6a82fb',
    width: '130%',
    marginLeft: '-1rem',
    marginBottom: '1rem',
  },
  navLink: {
    color: '#fff',
    marginRight: '1rem',
  },
  section: {
    padding: '4rem 2rem',
    margin: '0 auto',
    maxWidth: '1200px',
    borderRadius: '8px',
    backgroundColor: '#fff',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
  },
  hero: {
    textAlign: 'center',
    padding: '5rem 2rem',
    background: 'linear-gradient(to right, #6a82fb, #fc5c7d)',
    color: 'white',
    borderRadius: '8px',
  },
  heroH1: {
    fontSize: '3.5rem',
    opacity: 0,
    animation: 'fadeIn 2s forwards',
  },
  heroLead: {
    marginTop: '1rem',
    fontSize: '1.25rem',
  },
  heroBtn: {
    marginTop: '2rem',
    padding: '0.75rem 1.5rem',
    fontSize: '1.25rem',
    backgroundColor: '#ff4081',
    borderColor: '#ff4081',
  },
  sectionTitle: {
    marginBottom: '1.5rem',
    color: '#333',
  },
  card: {
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    border: 'none',
    backgroundColor: '#fff',
    color: '#333',
    height: '100%',
  },
  cardBody: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
  },
  cardTitle: {
    fontSize: '1.5rem',
    marginTop: '1rem',
  },
  cardText: {
    fontSize: '1rem',
  },
};

const ProductPage = () => {
  return (
    <div style={styles.body}>
      {/* Navigation Bar */}
      <Navbar expand="lg" style={styles.nav}>
        <Container fluid>
          <Navbar.Brand as={Link} to="/" style={{ color: '#fff' }}>sensAIra</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link as={Link} to="/" style={styles.navLink}>Home</Nav.Link>
              <Nav.Link as={Link} to="/product" style={styles.navLink}>Product</Nav.Link>
              <Nav.Link as={Link} to="/contact" style={styles.navLink}>Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Hero Section */}
      <section style={{ ...styles.section, ...styles.hero }}>
        <motion.h1 className="display-4" style={styles.heroH1} initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
          Discover sensAIra: Your Health, Our Priority
        </motion.h1>
        <p className="lead" style={styles.heroLead}>AI-powered wearable for proactive health monitoring</p>
        <Button variant="light" className="mt-4" style={styles.heroBtn}>
          <Link to="/buy" style={{ color: 'inherit', textDecoration: 'none' }}>Buy Now</Link>
        </Button>
      </section>

      {/* Key Features Section */}
      <section className="features" style={styles.section}>
        <h2 style={styles.sectionTitle}>Key Features</h2>
        <div className="row">
          {features.map((feature, idx) => (
            <div className="col-md-4 mb-4" key={idx}>
              <Card className="shadow-lg" style={styles.card}>
                <Card.Body style={styles.cardBody}>
                  <feature.icon className="text-primary mb-3" style={{ fontSize: '2.5rem', color: '#6a82fb' }} />
                  <div>
                    <Card.Title style={styles.cardTitle}>{feature.title}</Card.Title>
                    <Card.Text style={styles.cardText}>{feature.desc}</Card.Text>
                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
        </div>
      </section>

      {/* Pricing Section */}
      <section className="text-center py-5 bg-light" style={styles.section}>
        <h2 style={styles.sectionTitle}>Simple, Transparent Pricing</h2>
        <p>₹1999 for the device + 3 months free subscription. ₹99/month thereafter.</p>
        <Button variant="primary" className="mt-4" style={styles.heroBtn}>
          Buy Now
        </Button>
      </section>
    </div>
  );
};

export default ProductPage;
